  `create_user` varchar(255) DEFAULT NULL COMMENT '上传人的GUID',
  `create_date` datetime DEFAULT NULL,
  `update_user` varchar(255) DEFAULT NULL COMMENT '更新人GUID',
  `update_date` datetime DEFAULT NULL,
  `del_user` varchar(255) DEFAULT NULL COMMENT '删除人GUID',
  `del_date` datetime DEFAULT NULL,
  `isdel` enum('1','0') DEFAULT '0',
  `sys_module_guid` varchar(255) DEFAULT NULL COMMENT '模块GUID',
