-- Table structure for aiw_sys_message
-- ----------------------------
DROP TABLE IF EXISTS `aiw_sys_message`;
CREATE TABLE `aiw_sys_message` (
  `guid` varchar(100) NOT NULL,
  `title` varchar(250) DEFAULT NULL,
  `content` text,
  `sys_module_id` varchar(100) DEFAULT NULL COMMENT '利用模块表ID读取打开方式，为空就用默认方式打开',
  `param` varchar(250) DEFAULT NULL COMMENT '当sys_module_id不为零时的后接的参数',
  `createdate` int(11) DEFAULT '0',
  `createuser` varchar(250) DEFAULT NULL COMMENT '发送信息的用户GUID',
  `msg_level` smallint(6) DEFAULT NULL COMMENT '数字越高，重要性越强 如：0普通信息 10提醒 20警告 100重点关注',
  `isread` smallint(6) DEFAULT NULL COMMENT '0未读 1已读',
  `receive_user` varchar(250) DEFAULT NULL COMMENT '接收者用户GUID',
  PRIMARY KEY (`guid`)
