  `dingcan_riqi` date DEFAULT NULL COMMENT '享受订餐的日期',
  `beizhu` varchar(250) DEFAULT NULL COMMENT '系统为转入转出，取消，生成的备注',
  `dingcan_status` smallint(3) DEFAULT '0' COMMENT '0正常就餐、10转出中、20已转入、30转出成功、\r\n40转出失败 99取消',
  `dingcan_cancel_time` int(11) DEFAULT '0' COMMENT '如果订餐取消，记录订餐时间',
  `dingcan_cancel_beizhu` varchar(250) DEFAULT NULL,
  `dingcan_zhuanchu_beizhu` varchar(250) DEFAULT NULL COMMENT '转出备注',
  `dingcan_zhuanchu_time` int(11) DEFAULT '0' COMMENT '转出时间',
  `dingcan_zhuanchu_user` varchar(100) DEFAULT NULL COMMENT '当dingcan_status为20时，已转入，记录dingcan_user的GUID，新的接收人记录到dingcan_user',
  `dingcan_jieshou_beizhu` varchar(200) DEFAULT NULL COMMENT '接收备注',
  PRIMARY KEY (`guid`,`id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COMMENT='每天订餐表';

